import React from 'react'
import { Link } from 'react-router-dom'

const Home = () => {
    return (
        <>
            <section className="heading">
                <h2>What Do you need help with?</h2>
                <p>Please choose from an option below.</p>
            </section>
        </>
    )
}

export default Home
